//I2S transmitter: clk = bclk!
module I2S_transmitter
(
    input wire clk,
    input wire rstn,
    output wire lrclk,
    output wire bclk,
    output wire sdo
);

//Copy the input clk to clk
assign bclk = clk;

//Generate rlclk
reg [4:0] cntr;
always @ (negedge clk)
begin
    if(rstn == 1'b0)
        cntr <= 5'd0;
    else
        cntr <= cntr + 1;
end

reg lrclk_reg;
always @ (negedge clk)
begin
    if(rstn == 1'b0)
        lrclk_reg <= 1'b0;
    else if (cntr == 5'd31)
        lrclk_reg <= ~lrclk_reg;
end
assign lrclk = lrclk_reg;

//Shift out data
reg [31:0] ldata;
reg [31:0] rdata;
always @ (negedge clk)
begin
    if((rstn == 1'b0) || (cntr == 5'd31))
    begin
        ldata <= 32'h00fb5210;
        rdata <= 32'h00279ade;
    end
    else if (lrclk_reg == 1'b1)
        ldata <= {ldata[30:0], 1'b0};
    else
        rdata <= {rdata[30:0], 1'b0};
end
assign sdo = (lrclk_reg == 1'b1) ? ldata[31] : rdata[31];

endmodule

